import React from 'react';
import { Redirect } from 'react-router-dom';

class LoginPage extends React.Component {
    render(){
        return(
            <div class="col-sm">
                <div class="row">
                    <button type="button" class="btn btn-dark">Dark</button>
                </div>
            </div>
        );
    }
}

export default LoginPage;
